import React, { Component } from "react";

import "tabler-react/dist/Tabler.css";

import { Nav, Site, Button } from "tabler-react";

class App extends Component {
  render() {
    return (
      <Site>
        <Nav>
          <Nav.Item hasSubNav value="DashBoard" icon="globe" />
        </Nav>
      </Site>
    );
  }
}

export default App;
